import "./Services.css";
import Service from "../Service/Service";
function Services() {

    return (
        <div className="Services">
            <div className="updates"> <h6>Reacent updates</h6></div>
            <Service bgcolor="rgb(0, 123, 255" title="@bewithshumaila" content="Some representative placeholder content, with some information about this user. Imagine this being
                    some sort of status update, perhaps?"/>
            <Service bgcolor="rgb(232, 62, 140)" title="@bewithshakir" content="Some more representative placeholder content, related to this other user.
             Another status update, perhaps." />
            <Service bgcolor="#6f42c1" title="@username" content="This user also gets some representative placeholder content. Maybe they
              did something interesting, and you really want to highlight this in the recent updates."/>
               <div className="alls"><a href="#">All updates</a></div>
        </div>
    )
}
export default Services;
